import math

def is_prime(n):
    if n < 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def fibonacci(n):
    (a, b) = (0, 1)
    for _ in range(n):
        yield a
        (a, b) = (b, a + b)

def fib_dict():
    return {term: {'sqrt': math.sqrt(term), 'square': term ** 2} if is_prime(term) else (math.sqrt(term), term ** 2) for (idx, term) in enumerate(fibonacci(25), start=1) if term > 0}

